	public int lengthOfLongestSubstring(String s){
		Map<Character, Integer> map = new HashMap<Character, Integer>();
		int maxSubstrLongest = 0;
		int currentlen = 0;
		char chs[] = s.toCharArray();
		for(int i=0; i<chs.length; i++){
			//从左到右依次遍历一遍
			if(!map.containsKey(chs[i])){
				currentlen++;
				map.put(chs[i], i+1);
			}else{
				int index = map.get(chs[i]);
				for(int j=0; j<index; j++){
					map.remove(chs[j]);
				}
				map.put(chs[i], i+1);
				if(currentlen>maxSubstrLongest){
					maxSubstrLongest = currentlen;
				}
				currentlen=currentlen-index+1;
			}
		}
		maxSubstrLongest = (currentlen>maxSubstrLongest)?currentlen:maxSubstrLongest;
		
		return maxSubstrLongest;
	}
	
	/**
	 * 参考discuss中，利用字符串全部是ASCII码的128相对应，因此上方法中map可以直接使用此来对应替换
	 * 8ms
	 * @param s
	 * @return
	 */
	public int lengthOfLongestSubstring2(String s){
		int[] map = new int[128];
		Arrays.fill(map, -1);
		int start=-1, count=0, maxLen=0;
		//可以通过遍历一遍所有的字符串，但是可以有更优的解决方案
		int i=0;
		while(maxLen<s.length()-start && i!=s.length()){
			int index = map[s.charAt(i)];
			if(start<index){
				//如果已经找到，原先存了
				maxLen = (count>maxLen)?count:maxLen;
				count -= (index-start);
				start = index;
			}
			//如果未找到
			map[s.charAt(i)] = i++;
			count++;
		}
		maxLen = (count>maxLen)?count:maxLen;
		return maxLen;
	}
	
	/**
	 * 使用HashSet来代替HashMap来判断是否已经存在，我这里不知道为什么使用HashSet比HashMap快？<br/>
	 * 17ms <br/>
	 * 为什么用set，因为这里只需要判断是否重复就好了，不需要额外的做运算操作，消耗时间！<br/>
	 * 至少代码是很优美，相当简洁！<br/>
	 * @param s
	 * @return
	 */
	public int lengthOfLongestSubstring3(String s){
		if (s == null || s.length() == 0) return 0;
        int len = s.length();
        if (len == 1) return 1;
        HashSet<Character> set = new HashSet<Character>();
        int i, j = 0, maxLen = 0;
        for ( i = 0; i < len; i++ ) {
            char currentChar = s.charAt(i);
            if ( set.contains(currentChar) ) {                
                maxLen = Math.max(maxLen, i-j);
                while ( s.charAt(j) != s.charAt(i) ) set.remove(s.charAt(j++));               
                j++;
            }
           else set.add(currentChar);
        }
        return Math.max(maxLen, i-j);
	}
	
